import { FiXCircle } from "react-icons/fi";
import "./index.css";

export function ValueCard({ value }) {
  {
    console.log(value);
  }
  return (
    <li className="list flex">
      <div className="separator">
        <p className="list-name">{value.isName}</p>
        <p className="list-description">{value.isType}</p>
      </div>
      <div className="separator">
        <p className="list-value">{value.isAmount}</p>
        <FiXCircle className="detele_value_button" />
      </div>
    </li>
  );
}
